import * as React from 'react';
import { Text, View, Button } from 'react-native';
import axios from 'axios';
import { NavigationContainer } from '@react-navigation/native';
import HomeScreen from '../Screens/search'
import { createMaterialBottomTabNavigator } from '@react-navigation/material-bottom-tabs';


function ShowBooks({ route }) {
  return (
    <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
      <Text>Profile!</Text>
      <Text>
        {route?.params?.owner ? `${route.params.owner}'s Profile` : ''}
      </Text>
    </View>
  );
}


class ProfileScreen extends React.Component{
      componentDidMount() {



    const apiUrl = 'https://api.github.com/users/hacktivist123/repos';
    axios.get(apiUrl).then((repos) => {
      const allRepos = repos.data;
      this.setState({ loading: false, repos: allRepos });
      console.log(this.state);


});

  }

  render() {
      return(
    <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
      <Text>Profile!</Text>
      <Text>
        {this.props.route?.params?.owner ? `${this.props.route.params.owner}'s Profile` : ''}
      </Text>
      <Button
        title="Go to profile"
        onPress={() => this.props.navigation.push('ShowBooks')}
      />
    </View>
      );
};
}




function IssueScreen({ route }) {
  return (
    <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
      <Text>Profile!</Text>
      <Text>
        {route?.params?.owner ? `${route.params.owner}'s Profile` : ''}
      </Text>
    </View>
  );
}

const Tab = createMaterialBottomTabNavigator();

export default function App() {
  return (
    <NavigationContainer>
      <Tab.Navigator>
        <Tab.Screen name="Home" component={HomeScreen} />
        <Tab.Screen name="Profile" component={ProfileScreen} />
        <Tab.Screen name="Issue" component={IssueScreen} />
        <Tab.Screen name="ShowBooks" component={IssueScreen} tabBarVisible={false} />
      </Tab.Navigator>
    </NavigationContainer>
  );
}
